import React from "react";
import "./style.css";

// Component for the Navbar

function Navbar(props) {
  return (
    <nav classNameName="navbar">
      <ul>
        <li classNameName="brand">
          <a href="/">Clicky Game</a>
          </li>
        <li>
          Score: {props.score} | Top Score: {props.topScore}
        </li>
      </ul>
    </nav>













  );
}

export default Navbar;
